import { useState } from "react";


function CatFacts() {
    const [facts, setFacts] = useState(["Cats are cool", "Cats are nice"])
    const displayFacts = () =>{
        return facts.map(elem=>
            <li>{elem}</li>
        )
    }
    return (
        <ul>
            {displayFacts()}
        </ul>
    )
}

export default CatFacts;
